import { Link } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbarboot from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

const Navbar = () => {
  return (
    <header>
      {/* <div className="navbar animate__animated animate__fadeInLeft animate__slower">
        <Link to="/">
          <h2>Workout Buddy</h2>
        </Link>
        <div classNameName="right-nav">
          <ul>
            <li className="sign">Sign in</li>
            <li className="sign">Sign up</li>
          </ul>
          <p></p>
          <p className="sign"></p>
        </div>
      </div> */}

      <Navbarboot bg="dark" variant="dark">
        <Container>
          <Navbarboot.Brand>
            <Link to="/">
              <h1>Workout Buddy</h1>
            </Link>
          </Navbarboot.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home" className="sign">
              Sign in
            </Nav.Link>
            <Nav.Link href="#features" className="sign">
              Sign up
            </Nav.Link>
          </Nav>
        </Container>
      </Navbarboot>
    </header>
  );
};

export default Navbar;
